def my_func(expression):
    # Convert the expression into a list of tokens
    tokens = []
    i = 0
    while i < len(expression):
        if expression[i] in {'t', 'f', '|', '&'}:
            tokens.append(expression[i])
        i += 1

    # Helper function to evaluate the AND operation
    def evaluate_and(tokens):
        result = True
        while tokens:
            token = tokens.pop(0)
            if token == 't':
                result = result and True
            elif token == 'f':
                result = result and False
            elif token == '&':
                continue
            else:
                # If OR is encountered, we put the token back and break
                tokens.insert(0, token)
                break
        return result

    # Main evaluation function
    def evaluate_expression(tokens):
        result = False
        while tokens:
            token = tokens.pop(0)
            if token == 't':
                result = result or True
            elif token == 'f':
                result = result or False
            elif token == '|':
                continue
            elif token == '&':
                # If AND is encountered, we need to evaluate the AND sequence
                result = result or evaluate_and(tokens)
        return result

    # Start evaluating the expression
    return evaluate_expression(tokens)

