def my_func(expression: str) -> bool:
    # Split the expression into tokens
    tokens = list(expression)

    # Initialize a stack to evaluate the expression
    stack = []

    # Helper function to evaluate top of the stack
    def evaluate_top():
        # Evaluate the top two values with the operator in between
        right = stack.pop()
        op = stack.pop()
        left = stack.pop()

        if op == '&':
            stack.append(left and right)
        elif op == '|':
            stack.append(left or right)

    # Traverse each token in the expression
    for token in tokens:
        if token == 't':
            stack.append(True)
        elif token == 'f':
            stack.append(False)
        elif token in ('&', '|'):
            while len(stack) >= 3 and isinstance(stack[-1], bool) and isinstance(stack[-3], bool):
                evaluate_top()
            stack.append(token)

    # Final evaluation if needed
    while len(stack) > 1:
        evaluate_top()

    # The result should be the only item in the stack
    return stack[0]

